import { InputContainer } from 'components/common/styled';
import React from 'react';
import { useDispatch } from 'react-redux';
import { setLoginModalInvisible } from 'store/action/LoginAction';
import styled from 'styled-components';

function Signin() {
	const dispatch = useDispatch();
	const handleLoginModalInvisible = () => {
		dispatch(setLoginModalInvisible());
	};

	return (
		<ComponetsWrapper>
			<div className="modal-header-wrapper">
				회원가입
				<button
					type="button"
					onClick={() => handleLoginModalInvisible()}
				>
					<svg
						width="24"
						height="24"
						viewBox="0 0 24 24"
						color="#999"
					>
						<path
							fill="currentColor"
							d="M17.97 19.03a.75.75 0 001.06-1.06l-6.5-6.5a.75.75 0 00-1.06 0l-6.5 6.5a.75.75 0 001.06 1.06L12 13.06l5.97 5.97zM12 10.94L6.03 4.97a.75.75 0 00-1.06 1.06l6.5 6.5a.75.75 0 001.06 0l6.5-6.5a.75.75 0 00-1.06-1.06L12 10.94z"
						/>
					</svg>
				</button>
			</div>
			<div className="modal-content-wrapper">
				<div className="modal-emailinput-wrapper">
					<p>이메일</p>
					<div>
						<InputContainer
							type="text"
							placeholder="이름을 입력해 주세요."
							id="text"
						/>
					</div>
				</div>
				<div className="modal-emailinput-wrapper">
					<p>휴대폰 번호</p>
					<div>
						<div
							className="box-mobileinput-wrapper"
							style={{ marginTop: '11px' }}
						>
							<span>대한민국 +82</span>
							<select>
								<option value="+82">+82 South Korea</option>
								<option value="+81">+81 Japan</option>
								<option value="+886">+886 Taiwan</option>
								<option value="+852">+852 Hong Kong</option>
								<option value="+65">+65 Singapore</option>
								<option value="+93">+93 Afghanistan</option>
							</select>
							<i className="icon-play3" />
						</div>
						<div className="box-mobileinput-input">
							<InputContainer
								type="password"
								placeholder="(예시) 01034567890"
							/>
							<button
								type="button"
								className="btn-getcode"
								disabled=""
							>
								인증번호 받기
							</button>
						</div>
						<InputContainer
							className="box-inputcode"
							disabled
							type="password"
							placeholder="인증번호를 입력해주세요."
						/>
					</div>
				</div>
				<div className="modal-emailinput-wrapper">
					<p>비밀번호 확인</p>
					<div>
						<InputContainer
							type="password"
							placeholder="비밀번호를 다시 한번 입력해주세요."
							id="text"
						/>
					</div>
				</div>
				<div className="box-agreement-wrapper">
					<div class="style_wrapper__TaLWc Agreement_checkboxAll__SkIo_">
						<div class="style_check__svLur">
							<svg
								width="24"
								height="24"
								color="#3366ff"
								viewBox="0 0 24 24"
							>
								<path
									fill="currentColor"
									d="M18.75 2.25a3 3 0 0 1 3 3v13.5a3 3 0 0 1-3 3H5.25a3 3 0 0 1-3-3V5.25a3 3 0 0 1 3-3h13.5zm-2.252 5.719l-5.994 5.968-2.97-3.005a.75.75 0 0 0-1.067 1.055l3.5 3.54a.75.75 0 0 0 1.062.004l6.527-6.5a.75.75 0 0 0-1.058-1.062z"
								></path>
							</svg>
						</div>
						<div class="style_label__CZv3V">
							<input type="checkbox" name="allAgreement" />
							전체 동의
						</div>
					</div>
				</div>
			</div>
		</ComponetsWrapper>
	);
}

const ComponetsWrapper = styled.div`
	.box-inputcode {
		background-color: #f2f4f7 !important;
	}
	.btn-getcode {
		cursor: default;
		position: relative;
		margin-left: 10px;
		min-width: 117px;
		margin-top: 11px;
		padding: 16px 15px 14px;
		border-radius: 5px;
		background-color: #f2f4f7;
		font-weight: 700;
		color: #ccc;
	}
	.box-mobileinput-input {
		display: flex;
	}
	.modal-emailinput-wrapper {
		position: relative;
		padding-bottom: 22px;
		color: #767676;
	}
	.box-mobileinput-wrapper {
		margin-bottom: 10px;
		position: relative;
		flex: 1 1;
		line-height: 50px;
		padding: 0 15px;
		height: 50px;
		font-size: 15px;
		border-radius: 5px;
		border: 1px solid #e1e2e3;
		color: #333;
		select {
			position: absolute;
			top: 0;
			left: 0;
			width: 100%;
			padding: 0 15px;
			height: 50px;
			font-size: 15px;
			border-radius: 5px;
			border: 1px solid #e1e2e3;
			color: #333;
			opacity: 0;
		}
		.icon-play3 {
			position: absolute;
			top: 50%;
			transform: translateY(-50%) scale(0.8);
			right: 10px;
			font-size: 20px;
			color: #333;
			z-index: 1;
		}
	}
`;

export default Signin;
